.tp-shadow2:before, .tp-shadow2:after,
.tp-shadow3:before, .tp-shadow4:after
{
  z-index: -2;
  position: absolute;
  content: "";
  bottom: 10px;
  left: 10px;
  width: 50%;
  top: 85%;
  max-width:300px;
  background: transparent;
  box-shadow: 0 15px 10px rgba(0,0,0,0.8);

  transform: rotate(-3deg);
}

.tp-shadow2:after,
.tp-shadow4:after
{
  transform: rotate(3deg);
